import React from 'react';
import './NavBar.scss';

const NavBar = () => {
    return (
        <navbar className='navbar'>
            {/* <div className='container'> */}
            {/* <div className='navbar__wrap'> */}
            <div className='navbar__logo'>blog.mercuryo</div>
            <div className='navbar__menu'>
                <ul>
                    <li>
                        <a href=''>On- and off-ramps</a>
                    </li>
                    <li>
                        <a href=''>Banking-as-a-Service</a>
                    </li>
                    <li>
                        <a href=''>Crypto Pay in & Pay out</a>
                    </li>
                    <li>
                        <a href=''>Fiat Pay in & Pay out</a>
                    </li>
                    <li>
                        <a href=''>Wallet</a>
                    </li>
                </ul>
                <div className='navbat__search'></div>
            </div>
            {/* </div> */}
            {/* </div> */}
        </navbar>
    );
};

export default NavBar;
